A Time To Remember is a CD collection that takes 20 chart topping hits from each year from 1930 through 1980, and puts them on a 20-song CD for each year. Album art consists of major news events from that year with brief descriptions. 

This torrent contains all of the CD's. The files have been fully IDtagged including cover art for each CD. There are a total of 1200 songs. This torrent has two parts, due to the large size of the collection, and the dates in each part are shown in the title of the torrents.

